import React from "react";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const MyWayPage: React.FC<SlideProps> = ({ numberSlide, setNumberSlide }) => {
  return (
    <>
      <div className="slider-container header px-4 w-[100%]">
        <div className="wrapper">
          <h2 className="text-5xl my-8 text-center greeting font-medium ">
            My Way
          </h2>
          <p className="text-center my-8 mx-8 text-description">
          Since arriving in Germany <span className="color-r">(26.10.2022)</span> I have taken the following steps to return to work
          </p>
        </div>
        <div className="icons">
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(1)}
              >
                <i className="fa-solid fa-arrow-left"></i>&nbsp;Who I Was
              </button>
            </div>
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(3)}
              >
                What I Know &nbsp;<i className="fa-solid fa-arrow-right"></i>
              </button>
            </div>
          </div>
      </div>
    </>
  );
};

export default MyWayPage;
